import pandas as pdimport matplotlib.pyplot as plt# Step 1: Load the file using pandasfile_path = '/Users/Lemmen/temp/PET00.sns_2050-1x61-getm'  # Replace with your actual file pathwith open(file_path,'r') as file:  lines = file.readlines()speedups = []speedups = [line for line in lines if 'with speedup' in line]df = pd.DataFrame()datetime = [line.split(' INFO')[0] for line in speedups]df['datetime'] = pd.to_datetime(datetime, format='%Y%m%d %H%M%S.%f')df['component'] = [line.split()[6] for line in speedups]df['component'] = df['component'].replace('in', 'toplevel')df['speedup'] = [int(line.split()[-1]) for line in speedups]fig, ax = plt.subplots(figsize=(10, 6))# Iterate over unique categories and plot for each categoryfor category, group in df.groupby('component'):    ax.plot(group['datetime'], group['speedup'], label=category)for threshold in [300, 1000, 3000, 10000]:    ax.axhline(threshold, linestyle=':', color='gray')    ax.annotate(f'{threshold}', xy=(df['datetime'].max(), threshold), xytext=(5, 0),                textcoords='offset points', ha='right', va='center', color='gray',                bbox=dict(facecolor='white', edgecolor='none', boxstyle='round4'), zorder=2)# Set labels and titleax.set_yscale('log')ax.set_xlabel('Wallclock')ax.set_title('Speedup')ax.legend()# Show the plotplt.show()